INSERT [dbo].[lesson] ([id], [name], [order], [status], [video], [content], [typeid], [topicid], [quizzesid], [subjectid]) VALUES (23, N' Exception Handling', 2, 1, NULL, N'<p></p>
<h1 class="h1" style="line-height: 1.3em; margin-top: 5px; font-family: erdana, helvetica, arial, sans-serif; font-size: 29px; color: rgb(97, 11, 56); text-align: justify; background-color: rgb(255, 255, 255)">Exception Vs Error in Java</h1>
<p style="color: rgb(51, 51, 51); font-family: inter-regular, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify; background-color: rgb(255, 255, 255)">The general meaning of exception is<span>&nbsp;</span><strong style="font-family: inter-bold, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 700">a deliberate act of omission</strong><span>&nbsp;</span>while the meaning of error is<span>&nbsp;</span><strong style="font-family: inter-bold, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 700">an action that is inaccurate or incorrect</strong>. In Java,<span>&nbsp;</span><strong style="font-family: inter-bold, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 700">Exception,</strong><span>&nbsp;</span>and<span>&nbsp;</span><strong style="font-family: inter-bold, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 700">Error</strong><span>&nbsp;</span>both are subclasses of the<span>&nbsp;</span><a href="https://www.javatpoint.com/java-tutorial" style="color: green; text-decoration: none">Java</a><span>&nbsp;</span><strong style="font-family: inter-bold, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 700">Throwable</strong><span>&nbsp;</span>class that belongs to java.lang package. But there exist some significant differences between them. So, in this section, we are going to discuss the<span>&nbsp;</span><strong style="font-family: inter-bold, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 700">key differences between exception and error</strong>.</p>
<img src="https://static.javatpoint.com/core/images/exception-vs-error-in-java.png" alt="Exception Vs Error in Java" style="max-width: 100%; height: auto; color: rgb(51, 51, 51); font-family: inter-regular, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify; background-color: rgb(255, 255, 255)" />
<p style="color: rgb(51, 51, 51); font-family: inter-regular, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify; background-color: rgb(255, 255, 255)">Before moving ahead in this section let''s have a look at the hierarchy of the<span>&nbsp;</span><a href="https://www.javatpoint.com/post/java-throwable" style="color: green; text-decoration: none">Java Throwable class</a>.</p>
<img src="https://static.javatpoint.com/core/images/exception-vs-error-in-java2.png" alt="Exception Vs Error in Java" style="max-width: 100%; height: auto; color: rgb(51, 51, 51); font-family: inter-regular, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify; background-color: rgb(255, 255, 255)" />
<h2 class="h2" style="line-height: 1.3em; font-family: erdana, helvetica, arial, sans-serif; color: rgb(97, 11, 56); font-size: 25px; text-align: justify; background-color: rgb(255, 255, 255)">Exception</h2>
<p style="color: rgb(51, 51, 51); font-family: inter-regular, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify; background-color: rgb(255, 255, 255)">The term<span>&nbsp;</span><a href="https://www.javatpoint.com/exception-handling-in-java" style="color: green; text-decoration: none"><strong style="font-family: inter-bold, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 700">exception</strong></a><span>&nbsp;</span>is shorthand for the phrase<span>&nbsp;</span><strong style="font-family: inter-bold, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 700">exception event</strong>. It is an event that occurs during the execution of the program and interrupts the normal flow of program instructions. These are the errors that occur at compile time and run time. It occurs in the code written by the developers. It can be recovered by using the try-catch block and throws keyword. There are two types of exceptions i.e.<span>&nbsp;</span><strong style="font-family: inter-bold, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 700">checked</strong><span>&nbsp;</span>and<span>&nbsp;</span><strong style="font-family: inter-bold, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 700">unchecked</strong>.</p>
<p style="color: rgb(51, 51, 51); font-family: inter-regular, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify; background-color: rgb(255, 255, 255)">There are some important points that should be kept in mind while dealing with the exception:</p>
<div id="31d834e2-cf8d-4065-b4b0-2502cb42b89b" data-section="31d834e2-cf8d-4065-b4b0-2502cb42b89b" class="_ap_apex_ad" data-xpath="#city "> table:eq(0) &gt; tbody:eq(0) &gt; tr:eq(0) &gt; td:eq(0) &gt; p:eq(3)" data-section-id="" data-ap-network="custom" style="display: block; clear: both; text-align: center; margin: 10px auto; width: 535px; height: 300px; overflow: hidden;"&gt;<div><div id="primisPlayerContainerDiv"><iframe marginwidth="0" marginheight="0" frameborder="0" scrolling="no" title="Primis Frame" id="google_ads_iframe_dummy_sekindoParent933" style="width: 1px; height: 1px"></iframe></div></div></div>
<p></p>
<ul class="points" style="list-style: circle; line-height: 24px; font-size: 16px; text-align: justify; font-family: inter-regular, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255)"><li style="padding: 0.2em; line-height: 25px; margin-top: 4px">When an error is detected, an exception is thrown.</li><li style="padding: 0.2em; line-height: 25px; margin-top: 4px">Any exception that is thrown must be caught by the exception handler.</li><li style="padding: 0.2em; line-height: 25px; margin-top: 4px">If the programmer has forgotten to provide an exception handler, the exception will be caught by the catch-all exception handler provided by the system.</li><li style="padding: 0.2em; line-height: 25px; margin-top: 4px">Exception may be rethrown if exception handler is failure to handle it.</li></ul>
<h3 class="h3" style="line-height: 1.3em; font-family: erdana, helvetica, arial, sans-serif; color: rgb(97, 11, 75); font-size: 21px; text-align: justify; background-color: rgb(255, 255, 255)">Advantages of Exceptions</h3>
<ul class="points" style="list-style: circle; line-height: 24px; font-size: 16px; text-align: justify; font-family: inter-regular, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255)"><li style="padding: 0.2em; line-height: 25px; margin-top: 4px">It separates error handling code from regular code.</li><li style="padding: 0.2em; line-height: 25px; margin-top: 4px">It has the ability to propagate error reporting up the call stack of methods.</li><li style="padding: 0.2em; line-height: 25px; margin-top: 4px">The grouping or categorizing of exceptions is a natural outcome of the class hierarchy.</li></ul>
<p style="color: rgb(51, 51, 51); font-family: inter-regular, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify; background-color: rgb(255, 255, 255)">Let''s understand the exception through a Java program.</p>
<h3 class="h3" style="line-height: 1.3em; font-family: erdana, helvetica, arial, sans-serif; color: rgb(97, 11, 75); font-size: 21px; text-align: justify; background-color: rgb(255, 255, 255)">Example of Exception</h3>
<p style="color: rgb(51, 51, 51); font-family: inter-regular, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify; background-color: rgb(255, 255, 255)"><strong style="font-family: inter-bold, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 700">ExceptionExample.java</strong></p>
<div class="codeblock" style="border-width: 1px 1px 1px 4px; border-style: solid; border-color: rgb(213, 221, 198) rgb(213, 221, 198) rgb(213, 221, 198) rgba(113, 136, 107, 0.67); width: 808.232px; background-color: rgba(214, 189, 189, 0.3); margin-bottom: 8px; color: rgb(51, 51, 51); font-family: inter-regular, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify"><div class="dp-highlighter" style="width: 808.232px; overflow: scroll hidden; margin: 8px 0px !important"><div class="bar" style="padding-left: 45px"><div class="tools"><a href="https://www.javatpoint.com/exception-vs-error-in-java#" style="color: green; text-decoration: none; background: 0px 0px; border: none"></a><a href="https://www.javatpoint.com/exception-vs-error-in-java#" style="color: green; text-decoration: none; background: 0px 0px; border: none"></a><a href="https://www.javatpoint.com/exception-vs-error-in-java#" style="color: green; text-decoration: none; background: 0px 0px; border: none"></a></div></div><ol start="1" class="dp-j" style=" border: none"><li class="alt" style="width: 808.232px; margin: 4px 0px 0px; padding: 0px 3px 0px 10px !important; border: none; line-height: 25px"><span style=" border: none; background-color: inherit"><span class="keyword" style=" border: none; color: rgb(0, 102, 153); background-color: inherit; font-weight: 700">import</span><span style=" border: none; background-color: inherit">&nbsp;java.util.Scanner;&nbsp;&nbsp;</span></span></li><li style="margin: 4px 0px 0px; padding: 0px 3px 0px 10px !important; border: none; line-height: 25px"><span style=" border: none; background-color: inherit"><span class="keyword" style=" border: none; color: rgb(0, 102, 153); background-color: inherit; font-weight: 700">public</span><span style=" border: none; background-color: inherit">&nbsp;</span><span class="keyword" style=" border: none; color: rgb(0, 102, 153); background-color: inherit; font-weight: 700">class</span><span style=" border: none; background-color: inherit">&nbsp;ExcptionExample&nbsp;&nbsp;</span></span></li><li class="alt" style="width: 808.232px; margin: 4px 0px 0px; padding: 0px 3px 0px 10px !important; border: none; line-height: 25px"><span style=" border: none; background-color: inherit">{&nbsp;&nbsp;</span></li><li style="margin: 4px 0px 0px; padding: 0px 3px 0px 10px !important; border: none; line-height: 25px"><span style=" border: none; background-color: inherit"><span class="keyword" style=" border: none; color: rgb(0, 102, 153); background-color: inherit; font-weight: 700">public</span><span style=" border: none; background-color: inherit">&nbsp;</span><span class="keyword" style=" border: none; color: rgb(0, 102, 153); background-color: inherit; font-weight: 700">static</span><span style=" border: none; background-color: inherit">&nbsp;</span><span class="keyword" style=" border: none; color: rgb(0, 102, 153); background-color: inherit; font-weight: 700">void</span><span style=" border: none; background-color: inherit">&nbsp;main(String&nbsp;args[])&nbsp;&nbsp;&nbsp;</span></span></li><li class="alt" style="width: 808.232px; margin: 4px 0px 0px; padding: 0px 3px 0px 10px !important; border: none; line-height: 25px"><span style=" border: none; background-color: inherit">{&nbsp;&nbsp;</span></li><li style="margin: 4px 0px 0px; padding: 0px 3px 0px 10px !important; border: none; line-height: 25px"><span style=" border: none; background-color: inherit">Scanner&nbsp;sc&nbsp;=&nbsp;<span class="keyword" style=" border: none; color: rgb(0, 102, 153); background-color: inherit; font-weight: 700">new</span><span style=" border: none; background-color: inherit">&nbsp;Scanner(System.in);&nbsp;&nbsp;</span></span></li><li class="alt" style="width: 808.232px; margin: 4px 0px 0px; padding: 0px 3px 0px 10px !important; border: none; line-height: 25px"><span style=" border: none; background-color: inherit"