<div id="95ca01e6-3802-4be3-ae1d-012fe262f675" data-section="95ca01e6-3802-4be3-ae1d-012fe262f675" class="_ap_apex_ad" data-xpath="#city "> table:eq(0) &gt; tbody:eq(0) &gt; tr:eq(0) &gt; td:eq(0) &gt; p:eq(11)" data-section-id="" data-ap-network="adpTags" data-render-time="1656137748935" data-refresh-time="1656137749921" data-timeout="590" style="display: block; clear: both; text-align: center; margin: 10px auto 20px; width: 300px; height: 250px; overflow: hidden;<img src="https://static.javatpoint.com/core/images/exception-vs-error-in-java4.png" alt="Exception Vs Error in Java" style="max-width: 100%; height: auto; color: rgb(51, 51, 51); font-family: inter-regular, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify; background-color: rgb(255, 255, 255);" /></div>
<p style="color: rgb(51, 51, 51); font-family: inter-regular, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify; background-color: rgb(255, 255, 255)">We observe that on running the program, we get the<span>&nbsp;</span><strong style="font-family: inter-bold, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 700">StackOverflowError,</strong><span>&nbsp;</span>not an exception.</p>
<p style="color: rgb(51, 51, 51); font-family: inter-regular, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify; background-color: rgb(255, 255, 255)">Let''s discuss the key differences between exception and error.</p>
<h2 class="h2" style="line-height: 1.3em; font-family: erdana, helvetica, arial, sans-serif; color: rgb(97, 11, 56); font-size: 25px; text-align: justify; background-color: rgb(255, 255, 255)">Difference Between Exception and Error</h2>
<p style="color: rgb(51, 51, 51); font-family: inter-regular, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify; background-color: rgb(255, 255, 255)">In Java, Error, and Exception both are subclasses of the Java Throwable class that belongs to java.lang package.</p>
<table class="alt" style="width: 808.232px; border: 1px solid rgb(199, 204, 190); text-align: left; display: table; border-collapse: collapse; color: rgb(51, 51, 51); font-family: inter-regular, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255)"><tbody style="display: table-row-group"><tr style="display: table-row; vertical-align: inherit; border-color: inherit; background-color: rgb(239, 241, 235)"><th style=" background-color: rgb(199, 204, 190); font-size: 17px; font-family: &quot;times new roman&quot;; padding: 12px; vertical-align: top; text-align: left">Basis of Comparison</th><th style=" background-color: rgb(199, 204, 190); font-size: 17px; font-family: &quot;times new roman&quot;; padding: 12px; vertical-align: top; text-align: left">Exception</th><th style=" background-color: rgb(199, 204, 190); font-size: 17px; font-family: &quot;times new roman&quot;; padding: 12px; vertical-align: top; text-align: left">Error</th></tr><tr style="display: table-row; vertical-align: inherit; border-color: inherit; background-color: rgb(255, 255, 255)"><td style="border: 1px solid rgb(199, 204, 190); text-align: justify; padding: 8px; vertical-align: top; font-size: 16px; font-family: inter-regular, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); line-height: 1.7; display: table-cell"><strong style="font-family: inter-bold, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 700">Recoverable/ Irrecoverable</strong></td><td style="border: 1px solid rgb(199, 204, 190); text-align: justify; padding: 8px; vertical-align: top; font-size: 16px; font-family: inter-regular, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); line-height: 1.7; display: table-cell">Exception can be recovered by using the try-catch block. An error cannot be recovered.</td></tr><tr style="display: table-row; vertical-align: inherit; border-color: inherit; background-color: rgb(239, 241, 235)"><td style="border: 1px solid rgb(199, 204, 190); text-align: justify; padding: 8px; vertical-align: top; font-size: 16px; font-family: inter-regular, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); line-height: 1.7; display: table-cell"><strong style="font-family: inter-bold, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 700">Type</strong></td><td style="border: 1px solid rgb(199, 204, 190); text-align: justify; padding: 8px; vertical-align: top; font-size: 16px; font-family: inter-regular, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); line-height: 1.7; display: table-cell">It can be classified into two categories i.e. checked and unchecked.</td><td style="border: 1px solid rgb(199, 204, 190); text-align: justify; padding: 8px; vertical-align: top; font-size: 16px; font-family: inter-regular, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); line-height: 1.7; display: table-cell">All errors in Java are unchecked.</td></tr><tr style="display: table-row; vertical-align: inherit; border-color: inherit; background-color: rgb(255, 255, 255)"><td style="border: 1px solid rgb(199, 204, 190); text-align: justify; padding: 8px; vertical-align: top; font-size: 16px; font-family: inter-regular, system-ui, -apple-system, B