INSERT [dbo].[post] ([id], [title], [thumbnail], [content], [description], [featured], [flag], [status], [created_at], [updated_at], [userid], [categoryId]) VALUES (1009, N'How do you turn your passion into your purpose?', N'1d70fb3b-eafa-4dcf-b6d7-c886018109ff.png', N'                                <p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Passion</strong></p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">As an accomplished actor, athlete, and animal lover, Karen is no stranger to passion. You could say it’s a prerequisite for her. So when Karen found out that, just like people, animals can be discriminated against, she couldn’t stay offstage or on the sidelines. Karen’s love for animals motivated her to take action.</p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Process</strong></p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">Looking to change the lives of animals for the better, Karen found a course from the University of Edinburgh on Coursera and began to build the skills to make an impact. Through her Animal Behaviour & Welfare course, Karen learned about the current state of animal cruelty around the world and how much more global awareness is needed. She discovered how animal welfare organizations can focus on unserved parts of their community.</p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Purpose</strong></p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">Since enrolling on Coursera, Karen has started to spread awareness of animal neglect, abuse, and abandonment. She’s also proposing different projects for different communities to help animal welfare in her country. Karen has become more confident in speaking publicly and sharing her knowledge online and offline. She’s now actively participating in different forums and telling others about her personal experiences.</p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">What You Can Do</strong></p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">Just like Karen, when you find a new passion, you can do what it takes to give your work a new purpose. This can be a life-changing experience. It was for Karen. If you’re inspired to pursue new opportunities and ready to learn the skills you’ll need, you can come to Coursera to follow your passions and discover your purpose.</p><br /></p>
                            ', N' “Finding a passion is great. But having a purpose is even greater.” In the Philippines, Karen is living by these words as an animal rescuer and advocate. Like most goals in life, turning your passion into your purpose is easier said than done. But through her hard work in the Animal Behaviour & Welfare course offered by the University of Edinburgh, Karen has done exactly that. And she wants you to know that you can, too.

', 1, 1, 1, CAST(N'2022-06-12T00:06:03.040' AS DateTime), CAST(N'2022-06-23T13:26:14.120' AS DateTime), 1001, 1044)
GO
INSERT [dbo].[post] ([id], [title], [thumbnail], [content], [description], [featured], [flag], [status], [created_at], [updated_at], [userid], [categoryId]) VALUES (1010, N'What’s Driving Retention in Online Degree Programs? New Insights from our Data-Backed Report', N'5fb11217-de6d-4c6c-9d59-30e0bb750fe3.png', N'                                <p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">The Coursera platform has become a hub for leading universities to build and offer their online degrees to an eager audience of individuals worldwide. From the activities of thousands of students enrolled in our university partners’ degree programs, we are able to derive new insights on how individuals are engaging with online for-credit courses, what helps them succeed, and which activities most drive their retention. Throughout our new report,<span> </span><a href="https://about.coursera.org/press/wp-content/uploads/2022/05/Courseras-Drivers-of-Retention-in-Online-Degree-Programs-Report-1.pdf" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Drivers of Retention in Online Degree Programs</strong></a>, we offer data-driven best practices for driving greater retention in online degree programs. </p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">We see a variety of factors driving student retention in degree programs offered on the Coursera platform. The following are actions universities can take to bolster their students’ likelihood of staying in their programs:</p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700"><em style=" font-family: "Source Sans Pro", sans-serif; font-style: italic">Build on open content success</em></strong></p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">Recommend relevant open courses on Coursera. Students who complete an open course are 12% more likely to persist in their degree. Those who take open courses that stack into the degree are 3% more likely to remain in their programs.</p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700"><em style=" font-family: "Source Sans Pro", sans-serif; font-style: italic">Set students up for a strong start</em></strong></p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">Provide resources, office hours, and one-on-one question answering to help students submit their first assessment successfully, which increases their retention in the program by 6%. Performance is a strong indicator of students’ later persistence, with first-term grades emerging as especially critical.</p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700"><em style=" font-family: "Source Sans Pro", sans-serif; font-style: italic">Include staff grading</em></strong></p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">Boost motivation through expert grading and feedback. Having at least one staff-graded assessment drives a 6% increase in student retention.</p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700"><em style=" font-family: "Source Sans Pro", sans-serif; font-style: italic">Encourage frequent learning</em></strong></p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">Use techniques like short videos and smaller assessments throughout the course to help ensure students return frequently to the degree courses. Having students learn across more days leads to a 5% gain in retention and is a more significant driver than total learning time.</p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700"><em style=" font-family: "Source Sans Pro", sans-serif; font-style: italic">Design hands-on projects</em></strong></p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">Keep students progressing with hands-on projects where they can apply their new skills. Across writing, coding, and creative projects, these opportunities drive 3% greater retention. A final project is a great opportunity to provide this type of hands-on project and culminating experience for the course.</p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700"><em style=" font-family: "Source Sans Pro", sans-serif; font-style: italic">Use practice opportunities</em></strong></p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">Include ungraded assessments for low-stakes testing and to further students’ understanding. Having practice assessments drives a 2% increase in student degree retention. </p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">For more specifics and actionable takeaways, please visit our<span> </span><a href="https://about.coursera.org/press/wp-content/uploads/2022/05/Courseras-Drivers-of-Retention-in-Online-Degree-Programs-Report-1.pdf" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Drivers of Retention in Online Degree Programs</strong></a><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700"><span> </span></strong>report<strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700"><span> </span></strong>in full. We look forward to our continued partnership with universities to create more efficient and effective designs, elevating faculty’s online teaching to new heights.</p><br /></p>
                            ', N' The Coursera platform has become a hub for leading universities to build and offer their online degrees to an eager audience of individuals worldwide. From the activities of thousands of students enrolled in our university partners’ degree programs, we are able to derive new insights on how individuals are engaging with online for-credit courses, what helps them succeed, and which activities most drive their retention. Throughout our new report, Drivers of Retention in Online Degree Programs, we offer data-driven best practices for driving greater retention in online degree programs. ', 1, 1, 1, CAST(N'2022-06-12T00:06:44.943' AS DateTime), CAST(N'2022-06-23T13:26:04.007' AS DateTime), 1001, 34)
GO
INSERT [dbo].[post] ([id], [title], [thumbnail], [content], [description], [featured], [flag], [status], [created_at], [updated_at], [userid], [categoryId]) VALUES (1011, N'Coursera Conference 2022 Highlights', N'b267ea7d-e0fa-49fd-a415-b4dce72e21b3.png', N'                                                                <p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">By Betty Vandenbosch, Coursera’s Chief Content Officer</p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">I was delighted to have the opportunity to host our 10th annual Coursera Conference. Our virtual platform made it possible to bring together a truly global community. All told, 3,156 participants from 2,111 organizations representing 149 countries were able to attend, and we were thrilled to welcome 132 partner organizations representing 34 countries.</p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">Over the course of two days, we heard from more than 90 expert voices from 40 institutions and 15 countries. Together, we explored new opportunities for the future of learning and work in a digital world. As I reflect on the keynotes, fireside chats, and breakout sessions, I am reminded that pathways to careers were at the core of the conference.</p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">In her<span> </span><a href="https://conference.coursera.com/agenda/session/724913" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">keynote</a>, Mia Amor Mottley, the Prime Minister of Barbados, outlined how e-learning can provide opportunities to learners around the globe and highlighted the critical role online education can play for the developing world—particularly during times of crisis. She challenged us to be the catalyst for change and do all we can to help those who have found themselves on the wrong side of the digital divide.  </p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">Coursera CEO Jeff Maggioncalda presented a compelling array of facts demonstrating<span> </span><a href="https://conference.coursera.com/agenda/session/724916" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">the impact our work is having</a><span> </span>on the educational and economic health of our global community and highlighted the increasing importance of our partnerships as we work together to expand access to world-class learning.  </p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">Jeff also announced new degrees and credentials from leading universities to train people for jobs of the future. Among the partners making this possible are premier Indian universities including I<strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">ndian Institute of Management Ahmedabad, Indian Institute of Management Indore, Indian Institute of Science,<span> </span></strong>and<strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700"><span> </span>International Institute of Information Technology Bangalore.<span> </span></strong>Two new master’s degree programs from top-ranked universities in India,<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">the International Institute of Information Technology Bangalore<span> </span></strong>and<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">the Indian Institute of Technology Roorkee,<span> </span></strong>will help prepare learners for in-demand careers. Three postgraduate programs from<strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700"><span> </span>the Indian School of Business<span> </span></strong>and<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Macquarie University<span> </span></strong>will<strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700"><span> </span></strong>help learners advance in business and management and offer a chance to complete graduate-level learning from world-class institutions without committing to a full degree program. And, ten university-issued certificates from<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">the Indian Institute of Technology Guwahati, the Indian Institute of Technology Roorkee</strong>, and<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">the University of Colorado Boulder,<span> </span></strong>that generally take six months or less to complete, will help learners develop expertise in a specific field. Finally, in addition to academic partnerships, industry leaders including<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Accenture</strong>,<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">ADP</strong>,<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Campus</strong><span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">BBVA</strong>,<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Coinbase</strong>,<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Genentech</strong>,<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Goodwill</strong>,<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Hero</strong><span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Mindmine</strong>,<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">HR</strong><span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Certification Institute (HRCI)</strong>,<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">PwC India</strong>,<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">SAP</strong>, and<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Tally Education</strong><span> </span>will help expand our catalog of high-quality, job-relevant content. </p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">During the<span> </span><a href="https://conference.coursera.com/agenda/session/724919" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">Product Innovation</a><span> </span>session, our team announced a suite of new offerings and platform improvements to boost learner engagement, reduce time and complexity to author content, and help businesses, universities, and governments provide timely, accessible learning at scale. Here are a few that I am very excited about:<br style=" font-family: "Source Sans Pro", sans-serif" /></p><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Career Academy</strong><span> </span>gives any business, government, or academic institution the ability to offer individuals—even those with no college degree or prior work experience—an opportunity to learn the skills to enter a high-demand, entry-level digital job. Learners can access a full suite of Entry-Level Professional Certificates, practice their skills with Guided Projects, and explore career pathways and essential information on in-demand roles. </li><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Self-service content migration</strong><span> </span>from edX/Open edX and Canvas increases efficiency and ease of content authoring. During the pilot stages, our university partner Dartmouth College was able to seamlessly move more than 30 courses from edX to the Coursera platform with minimal effort from its program staff.</li><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Adjustable and data-driven deadlines, scheduled nudges, and AI-generated lecture summaries</strong><span> </span>work to better serve more than 100 Million learners on the Coursera platform and encourage them to continue with their learning journey.</li><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Upgrades to our grading and assessment features</strong><span> </span>now support awarding extra credit, viewing item history, and deterring plagiarism through ​​text similarity scoring.</li></ul><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">In our<span> </span><a href="https://conference.coursera.com/agenda/session/724921" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">visionary panel</a>, we learned how two university partners are collaborating to create degree pathways between institutions for the first time on Coursera. Students who graduate from the<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">University of London’s</strong><span> </span>online Bachelor of Science in Marketing or online Bachelor of Science in Business Administration will have a preferred admissions pathway into the<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">University of Illinois</strong>’ online Master’s of Management degree—creating a seamless path for lifelong learning. The<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">University of Illinois</strong><span> </span>discussed plans to expand the pathway to other Gies online graduate programs, including the Master’s of Business Administration, Master’s of Science in Accountancy, and stackable Graduate Certificates. </p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">To mark Coursera’s 10th anniversary, we took time to reflect on and celebrate what we have accomplished together as a community of innovative educators, and the impact we have had on learners across the globe. Coursera Chief Marketing Officer Kim Caldbeck led<span> </span><a href="https://conference.coursera.com/agenda/session/724920" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">a discussion</a><span> </span>with CEO Jeff Maggioncalda, our former CEO Rick Levin, and  Coursera’s founders, Daphne Koller and Andrew Ng, that explored milestones from the past 10 years—from that first Stanford course, through collaboration and innovation and Coursera’s international expansion, to the stackable learning and collaborations with partners, businesses, and governments that define us today and make us excited about the future. </p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">A perennial favorite at Conference is<span> </span><a href="https://conference.coursera.com/agenda/session/724928" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">the Outstanding Achievement Award Ceremony</a>, hosted by Andrew Ng. This year we had the opportunity to recognize and celebrate six recipients for their work to advance our shared mission of expanding access to world-class learning.<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Sungkyunkwan University</strong><span> </span>received the Learner’s First Award for their A Bridge to the World: Korean Language for Beginners course, which introduces learners to the language and culture of Korea.<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Google</strong><span> </span>received the Career Transformation award for their UX Design Certification, which takes learners with no background in UX design through all the fundamental skills to become a UX designer. The<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">University of Colorado Boulder</strong><span> </span>received the Innovation award for their Data Structures and Algorithms Specialization, which provides a pathway into their innovative degree program. For helping its employees achieve extraordinary success and career growth through the power of online learning,<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Capgemini</strong><span> </span>received the Talent Transformation award.<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Ghandi Institute of Technology and Management</strong><span> </span>received the Campus Transformation award for enabling over 20,000 students across three campuses and nine departments to quickly go online during the height of the pandemic. And, the<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">New York State Department of Labor</strong><span> </span>received the Government Innovation award for deploying an accessible training solution that provides health and wellness training, foundational skills, technical certifications, and job readiness training to communities hardest hit by the shutdown. Please join me in congratulating all the award recipients. </p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">Recordings for most of the sessions can be found under the session description on the<span> </span><a href="https://conference.coursera.com/page/2023127/agenda-" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">agenda page</a><span> </span>of the event website. I encourage you to watch the sessions that interest you and share the recordings with your colleagues.</p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">When I think about all the comments and conversations, I see unprecedented promise for a future with more equal opportunities than we’ve ever seen before. During the conference, we witnessed how this future is taking shape on Coursera today. There is no doubt in my mind about how important our work is. It’s powerful and life-changing.  At the end of the day, learners and employers will tell us what they need. We must be bold, willing to experiment, and consistently looking for ways to innovate. Most importantly, we must work together. </p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">I would like to thank our presenters, panelists, and participants for their time and their contributions. It was a wonderful experience for me. For those who were able to join us, I hope you had a great time and will come back next year. For those who were unable to join us, I hope you’ll watch the videos and join us next year. </p><br /></p>
                            
                            ', N'  I was delighted to have the opportunity to host our 10th annual Coursera Conference. Our virtual platform made it possible to bring together a truly global community. All told, 3,156 participants from 2,111 organizations representing 149 countries were able to attend, and we were thrilled to welcome 132 partner organizations representing 34 countries.', 1, 1, 1, CAST(N'2022-06-12T00:07:21.220' AS DateTime), CAST(N'2022-06-23T13:25:53.407' AS DateTime), 1001, 1053)
GO
INSERT [dbo].[post] ([id], [title], [thumbnail], [content], [description], [featured], [flag], [status], [created_at], [updated_at], [userid], [categoryId]) VALUES (1012, N'Announcing 2 master’s degrees and 13 credentials from leading global universities to help learners build digital skills', N'8582ef77-9586-40af-97d4-68e2bbeb538e.png', N'                                <p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">The global labor market continues to undergo profound change, exacerbated by the pandemic and automation. According to<span> </span><a href="https://www.mckinsey.com/featured-insights/future-of-work/the-future-of-work-after-covid-19" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">McKinsey</a>, demand for workers in fields including STEM and business is expected to increase even more by 2030 – which presents a meaningful opportunity for people across the globe.  </p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">To help learners everywhere participate in the digital economy, we’re introducing new degrees and credentials from leading universities to train people for jobs of the future. We’re also proud to welcome 15 new partners to the platform: key Indian universities such as<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Indian Institute of Management Ahmedabad</strong>,<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Indian Institute of Management Indore</strong>,<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Indian Institute of Science</strong>, and<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">International Institute of Information Technology Bangalore</strong><span> </span>and industry leaders including<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Accenture</strong>,<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">ADP</strong>,<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Campus BBVA</strong>,<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Coinbase</strong>,<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Genentech</strong>,<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Goodwill</strong>,<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Hero Mindmine</strong>,<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">HR Certification Institute (HRCI)</strong>,<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">PwC India</strong>,<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">SAP</strong>, and<span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Tally</strong><span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Education</strong><span> </span>will help expand our catalog of high-quality, job-relevant content.</p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">New degrees and pathways from leading universities prepare learners for in-demand careers</strong></p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">As more students prioritize flexibility and employability in their degree education, universities around the world are responding with innovative online programs that teach job-relevant skills. Today, we’re unveiling two new master’s degree programs from top-ranked universities in India: </p><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><a href="https://www.coursera.org/degrees/msc-data-science-iiitbangalore" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">MSc in Data Science</strong></a><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700"><span> </span>from the International Institute of Information Technology Bangalore*<span> </span></strong>— Offered by a<span> </span><a href="https://www.iiitb.ac.in/news-events/iiitb-ranked-among-the-top-10-technical-universities-in-india" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">top technical institute</a><span> </span>in India, this is the first data science degree from an Indian university on Coursera. The rigorous program combines high-quality instruction with real-world experience through applied projects. Graduates will be prepared for roles such as data scientist, data architect, and machine learning engineer. The first cohort is expected to begin by the end of the year. </li></ul><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><a href="https://www.coursera.org/degrees/emba-iitr" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Executive Masters in Business Administration</strong></a><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700"><span> </span></strong><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">from the Indian Institute of Technology Roorkee<span> </span></strong>— Offered by one of the premium institutes in India, this 2-year masters program with features including credit-based payment and flexibility in enrollment is aligned to the needs of Industry 4.0 and designed to develop capable managers skilled in both engineering and business. The program aims to prepare future leaders in high-growth industries. The first cohort is expected to begin in November 2022. </li></ul><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">I’m also pleased to share that, for the first time on Coursera, two university partners are collaborating to create degree pathways between institutions: students who graduate from the University of London’s online Bachelor of Science in Marketing or online Bachelor of Science in Business Administration will have a preferred admissions pathway into the University of Illinois’ online Master’s of Management degree – creating a seamless path for lifelong learning. The University of Illinois hopes to expand the pathway to other Gies online graduate programs, including the Master’s of Business Administration, Master’s of Science in Accountancy, and stackable Graduate Certificates.</p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Postgraduate programs from ISB and Macquarie help learners advance in business and management </strong></p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">Postgraduate programs on Coursera offer a chance to complete graduate-level learning from world-class institutions without committing to a full degree program. We are introducing three business-focused programs today: </p><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><a href="https://www.coursera.org/degrees/gmp-operations-supply-chain-isb" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Global Management Programme in Operations & Supply Chain</strong></a><span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">and</strong><span> </span><a href="https://www.coursera.org/degrees/gmp-infrastructure-isb" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Global Management Programme for Infrastructure</strong></a><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700"><span> </span>from the Indian School of Business</strong><span> </span>– The Global Management Programme in Infrastructure will equip learners to develop strategic plans, manage uncertainty and risks, and learn to communicate, market, and negotiate effectively. The Global Management Program in Operations & Supply Chain is designed to meet the increasing demand for techno-business managers for the operations and supply chain sector. The first cohorts are expected to begin in October 2022.</li></ul><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><a href="https://www.coursera.org/degrees/graduate-certificate-global-business-practice" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Graduate Certificate of Global Business Practice</strong></a><span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">from Macquarie University</strong><span> </span>–  Offered by one of Australia’s<span> </span><a href="https://www.mq.edu.au/study/why-study-here/our-reputation/facts-and-rankings" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">top-ranked</a><span> </span>business schools, this program helps professionals master the fundamentals of business, including global operations, international expansion, human resources management, marketing, finance, and more. This program serves as a pathway to the fully online Global MBA from Macquarie. Applications are open now. </li></ul><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">University-issued certificates from IIT Guwahati, IIT Roorkee, and CU Boulder teach skills of the future </strong></p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">University certificates generally take six months or less to complete and help learners develop expertise in a specific field. Today we are announcing 10 certificates:</p><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Six job-relevant Postgraduate Certificate Programs</strong><span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">from the Indian Institute of Technology Guwahati</strong><span> </span>– Programs in<span> </span><a href="https://www.coursera.org/certificates/cloud-computing-applications-iitguwahati" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">Cloud Computing Applications</a>;<span> </span><a href="https://www.coursera.org/certificates/deep-learning-computer-vision-xr-iitguwahati" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">Deep Learning for Computer Vision & Extended Reality (XR)</a>;<span> </span><a href="https://www.coursera.org/certificates/digital-manufacturing-iitguwahati" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">Digital Manufacturing</a>;<span> </span><a href="https://www.coursera.org/certificates/ux-design-human-computer-interaction-iitguwahati" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">UX Design & HCI</a>;<span> </span><a href="https://www.coursera.org/certificates/natural-language-processing-iitguwahati" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">Natural Language Processing</a>; and<span> </span><a href="https://www.coursera.org/certificates/robotics-mechatronics-iitguwahati" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">Robotics & Mechatronics</a><span> </span>will help learners gain the skills needed to succeed in today’s most in-demand roles. </li></ul><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><a href="https://www.coursera.org/certificates/machine-learning-finance-iitr" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Post Graduate Certificate in Machine Learning for Finance</strong></a><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700"><span> </span></strong><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">and</strong><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700"><span> </span></strong><a href="https://www.coursera.org/certificates/strategic-supply-chain-management-ai-iitr" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Post Graduate Certificate in Strategic Supply Chain Management with AI</strong></a><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700"><span> </span></strong><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">from the Indian Institute of Technology Roorkee</strong><span> </span>– Covering concepts such as supervised and unsupervised learning, natural language processing, and artificial neural networks, the Machine Learning for Finance program will provide learners with an overview of ML and its application to the finance industry. The Strategic Supply Chain Management program will provide foundational knowledge about the cutting-edge advances in intelligent supply chain strategies, driven by AI and ML technologies.</li></ul><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><a href="https://www.coursera.org/certificates/data-science-boulder" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Data Science Graduate Certificate</strong></a><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700"><span> </span>and</strong><span> </span><a href="https://www.coursera.org/certificates/engineering-management-boulder" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Engineering Management Graduate Certificate</strong></a><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700"><span> </span>from the University of Colorado Boulder</strong><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700"><span> </span></strong>– The Data Science Graduate Certificate will help learners develop interdisciplinary skills in data science with instruction from leading faculty and hands-on projects. With a focus on authentic leadership, project management, and finance, the Engineering Management Graduate Certificate is designed for both engineers who are looking to ascend into leadership roles and current managers preparing to lead technical teams. These certificates can count for credit towards CU Boulder’s fully online Master of Science in Data Science or Master of Engineering in Engineering Management, respectively. Enrollments for both programs are expected to open in August 2022. </li></ul><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">In addition to these degrees and credentials, we have also introduced a new<span> </span><a href="https://blog.coursera.org/introducing-career-academy" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">career training academy alongside entry-level certificates from industry educators</a><span> </span>and<span> </span><a href="https://blog.coursera.org/new-products-tools-and-features-2022/" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">improved our platform experience</a><span> </span>to help learners succeed in a digital-first world.</p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">We are honored to partner with some of the world’s best higher education institutions and industry leaders to widen our portfolio of high-quality content and credentials. I look forward to seeing how these new offerings will make learning on Coursera even more rewarding for learners across the globe.</p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700"><em style=" font-family: "Source Sans Pro", sans-serif; font-style: italic">* Approval from the University Grants Commission (UGC) in progress</em></strong></p><br /></p>
                            ', N' The global labor market continues to undergo profound change, exacerbated by the pandemic and automation. According to McKinsey, demand for workers in fields including STEM and business is expected to increase even more by 2030 – which presents a meaningful opportunity for people across the globe.  

', 0, 1, 1, CAST(N'2022-06-12T00:18:45.233' AS DateTime), CAST(N'2022-06-23T13:25:41.640' AS DateTime), 1001, 34)
