INSERT [dbo].[post] ([id], [title], [thumbnail], [content], [description], [featured], [flag], [status], [created_at], [updated_at], [userid], [categoryId]) VALUES (1013, N'New products, tools, and features to enhance teaching and learning on Coursera', N'62ea6ca6-d673-4dbf-a113-33f31a2a4286.jpeg', N'                                <p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 25px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700"><em style=" font-family: "Source Sans Pro", sans-serif; font-style: italic">By Shravan Goli, Chief Product Officer, Coursera</em></strong></p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">Today, we’re excited to announce new tools and features to support the learning, teaching, and program administration experiences on Coursera. From job-relevant skilling with<span> </span><a href="https://blog.coursera.org/introducing-career-academy/" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">Career Academy</a><span> </span>to maximizing content with new authoring features, we are pleased to roll out the following product innovations for our global learner, educator, and enterprise communities. </p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Boosting learner personalization and motivation</strong></p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">Each of the 100+ million learners on Coursera has a unique learning journey. To best serve each of their needs, we’re introducing tools and features that create an even more personalized, engaging learning experience.</p><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">PERSONALIZED SCHEDULES</strong><span> </span>– Learners can input their schedules into a course to automatically receive personalized course deadlines and goals to stay on track.<span> </span><em style=" font-family: "Source Sans Pro", sans-serif; font-style: italic">Launching later this quarter.</em></li></ul><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">DATA-DRIVEN DEADLINES<span> </span></strong>– Each item deadline within a course is calculated based on how long it took past completers to finish the item, helping create more realistic deadline suggestions for learners.<span> </span><em style=" font-family: "Source Sans Pro", sans-serif; font-style: italic">In beta, launching later this quarter.</em></li></ul><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">SCHEDULE NUDGES</strong><span> </span>– Learners get notified whether they are on track, ahead, or behind in their course with actionable next steps to keep them progressing efficiently.<span> </span><em style=" font-family: "Source Sans Pro", sans-serif; font-style: italic">In beta, launching later this quarter.</em></li></ul><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">LECTURE SUMMARIES</strong><span> </span>– ML-generated summaries of key lecture videos provide learners with an easy way to review prior course material, gain a quick understanding of a topic, and progress faster through a course.<span> </span><em style=" font-family: "Source Sans Pro", sans-serif; font-style: italic">Launching later this quarter.</em></li></ul><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">ADOBE GUIDED PROJECTS<span> </span></strong>– Learners can now work with real Adobe software in a virtual environment – no installation or license required – to gain hands-on skills, build a portfolio, and prepare for a UX/Design role. Additionally, each learner who completes an Adobe Guided Project will receive a complimentary month of access to Adobe Creative Cloud.</li></ul><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">FILE DOWNLOADS IN LABS</strong><span> </span>– With just a few clicks, learners can easily download files from Labs to work locally in their preferred development environment or to preserve their work. </li></ul><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Enabling high-quality content authoring and teaching</strong></p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">University and industry partner program staff are often the backbone of content authoring. The following products were designed to help make the authoring process more flexible for program staff, while still adhering to pedagogical best practices. </p><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">ACADEMIC INTEGRITY TOOLS<span> </span></strong>– When creating courses in degree programs, educators can combat academic dishonesty and plagiarism with text similarity scoring within staff-graded assignments across all prompt types.</li></ul><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">ITEM VERSION HISTORY<span> </span></strong>– To facilitate better collaboration among course staff, new tools will enable authors to view version history for all item types, examine previously published item versions, and write staff-facing comments about item version changes.<span> </span><em style=" font-family: "Source Sans Pro", sans-serif; font-style: italic">In beta, launching later this year.</em></li></ul><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">ACT AS LEARNER FEATURE<span> </span></strong>– Degree and MasterTrack program staff can more easily manage student needs in a course using the Act as Learner feature, which enables them to easily access the student course view and troubleshoot issues. </li></ul><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">RICH TEXT EDITOR ENHANCEMENTS</strong><span> </span>– When editing text in a course, educators will now see a view that aligns with the learner view. The new rich text editor includes greater customization and accessibility options, straightforward media renderings, seamless layout adjustments, and a live preview for math equations. Authoring becomes faster and easier with fewer clicks and better responsiveness. </li></ul><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">EXTRA CREDIT FEATURES<span> </span></strong>– Course staff can now author quizzes with extra credit questions, allow graders to award extra points on Staff Graded Assignment rubrics, and set item and course grade overrides to over 100%.</li></ul><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">COURSERA LABS ENHANCEMENTS</strong><span> </span>– Educators can scalably create learning experiences to prepare learners for real-world technical work environments with Labs sandboxes, assessments, and autograder. Additionally, educators can improve exam rigor in Labs by setting time and attempt limits on programming exams, including a time remaining display and auto-submission when time runs out.<span> </span><em style=" font-family: "Source Sans Pro", sans-serif; font-style: italic">Fully launching later this year.</em></li></ul><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Maximizing educators’ existing content</strong></p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">Knowing that educators are often strapped for time, we focused on streamlining the authoring experience with features that aim to make content creation and management more efficient.</p><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">SELF-SERVE LMS IMPORT</strong><span> </span>– With this new self-serve ingestion tool, educators can easily reuse and repurpose their existing content on Canvas in their courses on Coursera, significantly reducing the time to author.</li></ul><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">EDX INGESTION<span> </span></strong>–<strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700"><span> </span></strong>Educators can also migrate their existing content on edX and Open edX to their courses on Coursera, all via the self-serve edX content ingestion tool. Through this tool, university partner Dartmouth seamlessly moved 30+ courses to Coursera with minimal work for its program staff.        </li></ul><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">ITEM LINKING ENHANCEMENTS<span> </span></strong>– The new UX will provide educators with a more comprehensive view of all locations where an item is linked, to power efficient authoring of stackable programs through content syncing. Educators will have even more control over where changes are applied – including to live and upcoming sessions – without affecting archived or ended sessions.<em style=" font-family: "Source Sans Pro", sans-serif; font-style: italic"><span> </span>In beta, launching later this year.</em></li></ul><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">UPLOAD-BASED AUTHORING IN BULK<span> </span></strong>– Educators will be able to efficiently export and update course outlines in bulk, as well as re-import changes, while still adhering to high course quality standards.<span> </span><em style=" font-family: "Source Sans Pro", sans-serif; font-style: italic">Launching later this month.</em></li></ul><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">Powering streamlined, job-relevant learning for institutions</strong></p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">Today we announced<span> </span><a href="https://blog.coursera.org/introducing-career-academy/" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">Career Academy</a><span> </span>to help enterprises give individuals – even those with no college degree or prior work experience – the opportunity to learn the skills to enter a high-demand, entry-level digital job. We’re also excited to announce the following products and features to further help organizations target the right skills and reach their goals. </p><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">SKILLSET INTEGRATIONS<span> </span></strong>– Coursera SkillSets are now even easier for learners to access within their organization’s centralized learning platform of choice.</li></ul><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">CUSTOM SKILLSET CREATION –<span> </span></strong>Customers will be able to customize skills within SkillSets based on the organization’s unique needs and context, choosing from a variety of skills and setting proficiency targets to establish measurable learning goals.<span> </span><em style=" font-family: "Source Sans Pro", sans-serif; font-style: italic">Launching later this quarter.</em></li></ul><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">NEW LEVELSETS<span> </span></strong>– 60+ new LevelSet assessments across Data Science, Technology, Marketing, and Finance can assess learner skills proficiency to establish a baseline and personalize content recommendations.</li></ul><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">LEADERSHIP ACADEMY –<span> </span></strong>With the new Leadership Academy’s 42 SkillSets for all levels that teach 35+ in-demand human skills, organizations can help employees grow as leaders, drive productivity, adapt, and innovate in a rapidly changing world.  <span> </span><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700"> </strong></li></ul><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">CLIPS<span> </span></strong>– Learners will be able to address their in-the-moment learning needs with direct access to thousands of short videos and lessons from top companies and universities.<span> </span><em style=" font-family: "Source Sans Pro", sans-serif; font-style: italic">Available to customers later this quarter.</em></li></ul><ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700">SELF-SERVE PROGRAM MANAGEMENT –<span> </span></strong>Coursera for Campus institutions can independently build and manage the learning programs and curations they need for each new term using flexible tools to add the right content and structure to match their needs for each program.</li></ul><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">We are excited to share a preview of what’s live and in development at Coursera. Planned launch dates referenced here are subject to change and purchasing decisions should not be made on the basis of forthcoming features.</p><p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">As the needs of learners, educators, and institutions evolve, so does our approach to the Coursera platform. We remain dedicated to product iteration to best serve the global learner community and enable anyone, anywhere to transform their life through learning.</p><br /></p>
                            ', N' Today, we’re excited to announce new tools and features to support the learning, teaching, and program administration experiences on Coursera. From job-relevant skilling with Career Academy to maximizing content with new authoring features, we are pleased to roll out the following product innovations for our global learner, educator, and enterprise communities. ', 0, 1, 1, CAST(N'2022-06-12T00:19:43.520' AS DateTime), CAST(N'2022-06-23T13:25:32.390' AS DateTime), 1001, 1044)
GO
INSERT [dbo].[post] ([id], [title], [thumbnail], [content], [description], [featured], [flag], [status], [created_at], [updated_at], [userid], [categoryId]) VALUES (1014, N'Google launches new entry-level digital marketing and e-commerce certificate on Coursera, announces scholarship program', N'56c9c4ea-4d96-4d82-a98a-7aeedfc387fd.jpeg', N'                                <p></p>
<p style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 25px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)"><strong style=" font-family: "Source Sans Pro", sans-serif; font-weight: 700"><em style=" font-family: "Source Sans Pro", sans-serif; font-style: italic">By Betty Vandenbosch, Chief Content Officer at Coursera</em></strong></p>
<p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">Today, we are pleased to announce a new entry-level<span> </span><a href="https://www.coursera.org/professional-certificates/google-digital-marketing-ecommerce" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">Digital Marketing & E-commerce Professional Certificate</a><span> </span>from Google. The certificate is designed to prepare learners to launch a career in digital marketing and e-commerce. No prior degree or industry experience is required for the certificate, and it can be completed in under 6 months with 10 hours per week of study.</p>
<p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">The new program comes as businesses increasingly move operations and sales online, igniting demand for digital marketing and e-commerce talent across industries. In the next decade alone, an estimated<span> </span><a href="https://www.weforum.org/platforms/shaping-the-future-of-digital-economy-and-new-value-creation" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">70%</a><span> </span>of new value created in the global economy will be based on digitally enabled platform business models.</p>
<p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">The seven-course certificate is designed to equip learners in less than six months with the in-demand skills for jobs in this growing sector, including digital marketing specialist, e-commerce specialist, and marketing coordinator. Taught by Google experts, the program teaches how to develop digital marketing and e-commerce strategies, attract customers, measure marketing and customer activity, and build successful e-commerce stores. Learners will also gain hands-on experience with key workplace tools such as Canva, Constant Contact, Hootsuite, HubSpot, MailChimp, Shopify, Twitter, and Google. The certificate costs $39 per month.</p>
<p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">Upon completion, learners in the US will have access to a job platform where they can directly apply for jobs at<span> </span><a href="https://grow.google/employers/" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">150+</a><span> </span>employers committed to hiring from a skilled, diverse talent pool, including Crate & Barrel, Deloitte, Infosys, Wayfair, Verizon, and Google.</p>
<p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)"><em style=" font-family: "Source Sans Pro", sans-serif; font-style: italic">“Technology continues to drive economic growth and job opportunities. It’s essential that both job seekers and companies have access to the skills needed to grow an online presence and unlock new areas of economic potential,” said Lisa Gevelber, Founder, Grow with Google. “Google is thrilled to help through our Digital Marketing and E-commerce Certificate and our commitment to enable every American business to upskill their employees at no cost.” </em></p>
<p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">To help businesses get the critical skills they need to thrive and to help employees grow their careers, Google is offering eligible enterprises in the U.S. up to 500 scholarships for employees to take Google Professional Certificates on Coursera. To learn more about the offering, including eligibility requirements and how to apply, go to:<span> </span><a href="https://www.coursera.org/google-certificates-for-business" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">https://www.coursera.org/google-certificates-for-business</a> </p>
<p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">The new digital marketing and e-commerce certificate joins a<span> </span><a href="https://www.coursera.org/google-career-certificates" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">growing catalog</a><span> </span>of Google entry-level programs on Coursera that include IT support, data analytics, project management, and UX design. We are proud to continue our partnership with Google to further expand access to key skills needed to launch quality careers in expanding digital fields. </p>
                            ', N' By Betty Vandenbosch, Chief Content Officer at Coursera Today, we are pleased to announce a new entry-level Digital Marketing & E-commerce Professional Certificate from Google. The certificate is designed to prepare learners to launch a career in digital marketing and e-commerce. No prior degree or industry experience is required for the certificate, and it can', 0, 1, 1, CAST(N'2022-06-12T00:20:47.123' AS DateTime), CAST(N'2022-06-23T13:25:22.610' AS DateTime), 1001, 34)
GO
INSERT [dbo].[post] ([id], [title], [thumbnail], [content], [description], [featured], [flag], [status], [created_at], [updated_at], [userid], [categoryId]) VALUES (1015, N'Coursera Partners with AWS to Extend Cloud Computing Training to Businesses ', N'b8033f18-019d-48d9-bdb6-6427cb790f50.jpeg', N'                                                                <p></p>
<p style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 25px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)"><em style=" font-family: "Source Sans Pro", sans-serif; font-style: italic">By Zac Rule, Vice President Enterprise, Americas at Coursera</em></p>
<p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)"></p>
<figure class="wp-block-image size-large is-resized" style="font-family: "Source Sans Pro", sans-serif; display: block; margin: 0px 0px 1em; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255); text-align: center;"><img src="https://149357281.v2.pressablecdn.com/wp-content/uploads/2022/04/Coursera-AWS-joint-logos-1024x536.png" class="wp-image-60095" width="466" height="244" srcset="https://149357281.v2.pressablecdn.com/wp-content/uploads/2022/04/Coursera-AWS-joint-logos-1024x536.png 1024w , https://149357281.v2.pressablecdn.com/wp-content/uploads/2022/04/Coursera-AWS-joint-logos-600x314.png 600w , https://149357281.v2.pressablecdn.com/wp-content/uploads/2022/04/Coursera-AWS-joint-logos-768x402.png 768w , https://149357281.v2.pressablecdn.com/wp-content/uploads/2022/04/Coursera-AWS-joint-logos.png 1200w " sizes="(max-width: 466px) 100vw, 466px" style=" font-family: "Source Sans Pro", sans-serif; max-width: 100%; height: auto; vertical-align: bottom; border-radius: inherit" /></figure>
<p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">The pace of innovation is accelerating and business leaders are more focused on building a workforce with the high-demand digital skills needed to thrive in the future.</p>
<p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">Today, Coursera is excited to announce that it has joined the Amazon Web Services (AWS) Partner Network (APN), a global community of more than 100,000 companies that provide Information Technology (IT) solutions and services for businesses. Through this announcement, Coursera will offer AWS cloud training, along with broader skills training to help companies accelerate digital transformation. In addition, Coursera will now be available to customers in<span> </span><a href="https://aws.amazon.com/marketplace/pp/prodview-gyjnp7idccuns?sr=0-1&ref_=beagle&applicationId=AWSMPContessa" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">AWS Marketplace</a>, a digital catalog with thousands of software listings from independent software vendors that make it easy to find, test, buy and deploy software that runs on AWS.  This integrated customer experience allows businesses to seamlessly consolidate billing, streamline procurement processes, and negotiate custom contract terms. </p>
<p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">Coursera for Business provides companies across the globe with role-based skills development featuring world-class content, hands-on learning, and the ability to track, measure, and benchmark skills through a single, unified platform.</p>
<p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">Raising the level of cloud skills proficiency is a major area of need for businesses that are looking to remain competitive in the workforce of the future. Coursera is working with AWS to enable businesses to deliver job-relevant cloud training to employees around the world.</p>
<p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">Coursera is offering a variety of courses through the AWS Marketplace including:</p>
<ul style=" font-family: "Source Sans Pro", sans-serif; margin: 0px 0px 28px 40px; color: rgb(31, 31, 31); font-size: 16px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255)"><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><a href="https://www.coursera.org/learn/aws-machine-learning" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">Getting Started with AWS Machine Learning</a>, by Blaine Sundrud, AWS</li><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><a href="https://www.coursera.org/learn/aws-fundamentals-building-serverless-applications" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">AWS Fundamentals: Building Serverless Applications</a>, by Bobbie Atristain, Adam Becker, Wes Gruver, Jonathan Dion, and Rick Hurst, AWS</li><li style=" font-family: "Source Sans Pro", sans-serif; list-style-type: none; padding-left: 10px; margin: 15px 0px 15px -13px; text-indent: -13px"><a href="https://www.coursera.org/learn/aws-cloud-technical-essentials" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">AWS Cloud Technical Essentials</a>, by Alana Layton and Morgan Willis, AWS</li></ul>
<p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">During this period of rapid change, more businesses are looking to harness the power of cloud technology. Together, Coursera and AWS will help organizations develop essential cloud skills needed to unlock more effective ways to scale their business, reduce costs, and drive stronger innovation.</p>
<p style=" font-family: "Source Sans Pro", sans-serif; margin: 25px 0px; font-size: 16px; line-height: 24px; letter-spacing: -0.1px; color: rgb(31, 31, 31); background-color: rgb(255, 255, 255)">Coursera is now available in AWS Marketplace to customers globally. For additional information, visit<span> </span><a href="https://aws.amazon.com/marketplace/pp/prodview-gyjnp7idccuns?sr=0-1&ref_=beagle&applicationId=AWSMPContessa" style=" font-family: "Source Sans Pro", sans-serif; background: 0px 0px; transition: all 0.1s ease-in-out 0s; color: rgb(0, 86, 210); text-decoration: none">here</a>. </p>
                            
                            ', N'  The pace of innovation is accelerating and business leaders are more focused on building a workforce with the high-demand digital skills needed to thrive in the future.', 1, 1, 1, CAST(N'2022-06-12T00:22:25.377' AS DateTime), CAST(N'2022-06-23T13:25:13.417' AS DateTime), 1001, 36)
GO
INSERT [dbo].[post] ([id], [title], [thumbnail], [content], [description], [featured], [flag], [status], [created_at], [updated_at], [userid], [categoryId]) VALUES (1016, N'10 years of learning: Coursera celebrates 100 million global learners and a new Machine Learning Specialization from co-founder Andrew Ng', N'1ff28c53-6313-4b33-9bad-ad3029ece956.jpeg', N'                                                                                                <p>Ten years ago, Daphne Koller and Andrew Ng had <a href="http://blog.coursera.org/celebrating-10-years-of-learning-without-limits/" source="" sans="" pro="" sans-serif="" background:="" 0px="" transition:="" all="" 1s="" ease-in-out="" 0s="" color:="" rgb="" 0="" 86="" 210="" text-decoration:="" none="">an idea</a>—make world-class education available to anyone, anywhere. Ever since, you’ve been demonstrating just how powerful that idea can be. You’ve shown the world what’s possible when you learn without limits.We think the best way to celebrate this milestone is to celebrate you, and all you’ve learned on Coursera. And as we take a moment to pause and reflect on our journey together, we’d like to share a few things we’ve learned about you along the way. </p>


<p style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 25px="" 0px="" font-size:="" 16px="" line-height:="" 24px="" letter-spacing:="" -0="" 1px="" color:="" 31="" background-color:="" rgb="" 255="">Here are ten things that have always been true about Coursera learners!</p>


<ol style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 0px="" 28px="" 40px="" color:="" 31="" font-size:="" 16px="" letter-spacing:="" -0="" 1px="" background-color:="" rgb="" 255=""><li style=" font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" decimal=""><strong style=" font-family: " source="" sans="" pro="" sans-serif="" font-weight:="" 700="">You’re global.</strong><ul style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 0px="" 28px="" 40px=""><li style=" font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" none="" padding-left:="" 10px="" margin:="" 0px="" 15px="" text-indent:="" -13px="">Our community is now<span> </span><strong style=" font-family: " source="" sans="" pro="" sans-serif="" font-weight:="" 700="">100 million strong</strong>, and you’re joining us from nearly every country in the world. </li></ul></li><li style=" font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" decimal=""><strong style=" font-family: " source="" sans="" pro="" sans-serif="" font-weight:="" 700="">You have the courage to pursue change.</strong> <ul style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 0px="" 28px="" 40px=""><li style=" font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" none="" padding-left:="" 10px="" margin:="" 0px="" 15px="" text-indent:="" -13px="">“It can be easy to define yourself in terms of your current job. Learning to code helped me see past that.” –<span> </span><a href="https://blog.coursera.org/learner-story-film-architecture-python-programming/" style=" font-family: " source="" sans="" pro="" sans-serif="" background:="" 0px="" transition:="" all="" 1s="" ease-in-out="" 0s="" color:="" rgb="" 0="" 86="" 210="" text-decoration:="" none="">Krystal</a>, US </li></ul></li><li style=" font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" decimal=""><strong style=" font-family: " source="" sans="" pro="" sans-serif="" font-weight:="" 700="">You give back. </strong><ul style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 0px="" 28px="" 40px=""><li style=" font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" none="" padding-left:="" 10px="" margin:="" 0px="" 15px="" text-indent:="" -13px="">Dedicated learners like those of you in our<span> </span><a href="https://translate-coursera.org/#/overview" style=" font-family: " source="" sans="" pro="" sans-serif="" background:="" 0px="" transition:="" all="" 1s="" ease-in-out="" 0s="" color:="" rgb="" 0="" 86="" 210="" text-decoration:="" none="">Global Translator Community</a><span> </span>have helped create 21,000 subtitles for courses in over<span> </span><strong style=" font-family: " source="" sans="" pro="" sans-serif="" font-weight:="" 700="">56 languages</strong>. </li></ul></li><li style=" font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" decimal=""><strong style=" font-family: " source="" sans="" pro="" sans-serif="" font-weight:="" 700="">You love a good challenge. </strong><ul style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 0px="" 28px="" 40px=""><li style=" font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" none="" padding-left:="" 10px="" margin:="" 0px="" 15px="" text-indent:="" -13px=""><strong style=" font-family: " source="" sans="" pro="" sans-serif="" font-weight:="" 700="">217,000</strong><span> </span>of you have completed a<span> </span><a href="https://www.coursera.org/courses?query=capstone" style=" font-family: " source="" sans="" pro="" sans-serif="" background:="" 0px="" transition:="" all="" 1s="" ease-in-out="" 0s="" color:="" rgb="" 0="" 86="" 210="" text-decoration:="" none="">capstone project</a>. </li></ul></li><li style=" font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" decimal=""><strong style=" font-family: " source="" sans="" pro="" sans-serif="" font-weight:="" 700="">You love to share what you learn.</strong><ul style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 0px="" 28px="" 40px=""><li style=" font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" none="" padding-left:="" 10px="" margin:="" 0px="" 15px="" text-indent:="" -13px="">“Coursera helped me engage my new community. By learning, I can be an active citizen wherever I am.” –<span> </span><a href="https://time.com/4825289/world-refugee-day-education-hadi-althib/" style=" font-family: " source="" sans="" pro="" sans-serif="" background:="" 0px="" transition:="" all="" 1s="" ease-in-out="" 0s="" color:="" rgb="" 0="" 86="" 210="" text-decoration:="" none="">Hadi</a>, Turkey</li></ul></li><li style=" font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" decimal=""><strong style=" font-family: " source="" sans="" pro="" sans-serif="" font-weight:="" 700="">You’re committed to transformation.</strong><ul style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 0px="" 28px="" 40px=""><li style=" font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" none="" padding-left:="" 10px="" margin:="" 0px="" 15px="" text-indent:="" -13px=""><strong style=" font-family: " source="" sans="" pro="" sans-serif="" font-weight:="" 700="">2.5 million</strong><span> </span>of you are learning job-ready skills in Professional Certificate programs so you can launch new careers, pursue new opportunities, and reach new milestones. More than<span> </span><strong style=" font-family: " source="" sans="" pro="" sans-serif="" font-weight:="" 700="">16,000</strong><span> </span>of you are on your way to earning a master’s or bachelor’s degree. And what about you first-time learners on Coursera? More than 65% of you will go on to enroll in more courses!</li></ul></li><li style=" font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" decimal=""><strong style=" font-family: " source="" sans="" pro="" sans-serif="" font-weight:="" 700="">You’re courageous.</strong><ul style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 0px="" 28px="" 40px=""><li style=" font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" none="" padding-left:="" 10px="" margin:="" 0px="" 15px="" text-indent:="" -13px="">“Never let anyone tell you that you can’t learn or do something. I was discouraged by a lot of people when I wanted to learn how to code. They told me I was too old to learn something ‘that hard.’ Now here I am—I showed them that nothing is impossible!” –<span> </span><a href="https://blog.coursera.org/self-taught-web-developer-proves-that-anything-is-possible/" style=" font-family: " source="" sans="" pro="" sans-serif="" background:="" 0px="" transition:="" all="" 1s="" ease-in-out="" 0s="" color:="" rgb="" 0="" 86="" 210="" text-decoration:="" none="">Julio R., Chile</a></li></ul></li><li style=" font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" decimal=""><strong style=" font-family: " source="" sans="" pro="" sans-serif="" font-weight:="" 700="">You’re always ready to learn – anywhere, anytime.</strong><ul style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 0px="" 28px="" 40px=""><li style=" font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" none="" padding-left:="" 10px="" margin:="" 0px="" 15px="" text-indent:="" -13px="">You’ve watched over<strong style=" font-family: " source="" sans="" pro="" sans-serif="" font-weight:="" 700=""><span> </span>282 million</strong><span> </span>lectures on mobile—on lunch breaks, commutes, and more!</li></ul></li><li style=" font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" decimal=""><strong style=" font-family: " source="" sans="" pro="" sans-serif="" font-weight:="" 700="">You’re building new skills.</strong><ul style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 0px="" 28px="" 40px=""><li style=" font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" none="" padding-left:="" 10px="" margin:="" 0px="" 15px="" text-indent:="" -13px=""><strong style=" font-family: " source="" sans="" pro="" sans-serif="" font-weight:="" 700="">“I’ve always wanted to upskill myself, but I didn’t know I could do it online and earn certificates from well-known universities. I enrolled in my first-ever course and loved it! In fact, I fell in love with learning!<span> </span></strong>I started taking courses one after another and I recently completed the Google Data Analytics Professional Certificate program. The courses in this program were perfectly tailored for beginners. I’m so grateful to have discovered Coursera and thankful to @Google for creating such a great, informative program. I’ve gained so many skills!” –<span> </span><a href="https://www.instagram.com/p/CVvj7t-MALM/" style=" font-family: " source="" sans="" pro="" sans-serif="" background:="" 0px="" transition:="" all="" 1s="" ease-in-out="" 0s="" color:="" rgb="" 0="" 86="" 210="" text-decoration:="" none="">@_rakshith.s.n</a> </li></ul></li><li style=" font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" decimal=""><strong style=" font-family: " source="" sans="" pro="" sans-serif="" font-weight:="" 700="">You continue to learn without limits.</strong><ul style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 0px="" 28px="" 40px=""><li style=" font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" none="" padding-left:="" 10px="" margin:="" 0px="" 15px="" text-indent:="" -13px="">As of 2021, you’ve collectively enrolled in more than<span> </span><strong style=" font-family: " source="" sans="" pro="" sans-serif="" font-weight:="" 700="">194 million</strong><span> </span>courses. </li></ul></li></ol>


<p style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 25px="" 0px="" font-size:="" 16px="" line-height:="" 24px="" letter-spacing:="" -0="" 1px="" color:="" 31="" background-color:="" rgb="" 255="">While you continue to learn on Coursera, we continue to learn from you. Your dedication, commitment, and passion are what motivate us every day. Thank you for ten remarkable years, and here’s to the next amazing decade together!</p>


<br />
                            
                            
                            ', N'     Ten years ago, Daphne Koller and Andrew Ng had an idea—make world-class education available to anyone, anywhere. Ever since, you’ve been demonstrating just how powerful that idea can be. You’ve shown the world what’s possible when you learn without limits.', 1, 1, 1, CAST(N'2022-06-12T00:23:57.180' AS DateTime), CAST(N'2022-06-23T13:24:52.533' AS DateTime), 1001, 1060)
GO
INSERT [dbo].[post] ([id], [title], [thumbnail], [content], [description], [featured], [flag], [status], [created_at], [updated_at], [userid], [categoryId]) VALUES (1018, N'Coursera doubles down on Middle East with new leadership, content and platform features ?', N'fa7ce9d1-e3bb-4963-aba5-9c198f19fba3.jpeg', N'                                                                                                                                                                                                                                <p><br /></p>
<p style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 0px="" 25px="" font-size:="" 16px="" line-height:="" 24px="" letter-spacing:="" -0="" 1px="" color:="" 31="" background-color:="" rgb="" 255=""><em style=" font-family: " source="" sans="" pro="" sans-serif="" font-style:="" italic="">Anthony Tattersall, Vice President of EMEA at Coursera</em></p>
<p style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 25px="" 0px="" font-size:="" 16px="" line-height:="" 24px="" letter-spacing:="" -0="" 1px="" color:="" 31="" background-color:="" rgb="" 255="">The accelerated adoption of online learning during the pandemic has created new opportunities for large-scale skills development in the Middle East (ME). Many more learners in the region are using online learning to develop job-relevant skills in a rapidly changing economy. </p>
<p style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 25px="" 0px="" font-size:="" 16px="" line-height:="" 24px="" letter-spacing:="" -0="" 1px="" color:="" 31="" background-color:="" rgb="" 255="">Coursera has over 4.8 million learners in the Middle East. More than 100 organisations in the region use Coursera to upskill students, employees and citizens, including institutions like Abu Dhabi School of Government, Emirate NBD Bank, and Effat University.</p>
<p style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 25px="" 0px="" font-size:="" 16px="" line-height:="" 24px="" letter-spacing:="" -0="" 1px="" color:="" 31="" background-color:="" rgb="" 255="">Building on the growing momentum we see across the region, we’re excited to share new updates to better serve learners and institutions. </p>
<p style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 25px="" 0px="" font-size:="" 16px="" line-height:="" 24px="" letter-spacing:="" -0="" 1px="" color:="" 31="" background-color:="" rgb="" 255=""><strong style=" font-family: " source="" sans="" pro="" sans-serif="" font-weight:="" 700="">Enabling<span> </span></strong><strong style=" font-family: " source="" sans="" pro="" sans-serif="" font-weight:="" 700="">Arabic right-to-left functionalities</strong><strong style=" font-family: " source="" sans="" pro="" sans-serif="" font-weight:="" 700=""><br style=" font-family: " source="" sans="" pro="" sans-serif="" /></strong>Our recently launched right-to-left functionalities make navigating Coursera in Arabic a more seamless experience for learners. There are more than 400 million Arabic speakers in the world today, and this feature ensures Arabic enterprise learners can easily navigate Coursera, including the homepage, search and browse, assessments, grades, notes, transcripts, and e-mails. </p>
<p style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 25px="" 0px="" font-size:="" 16px="" line-height:="" 24px="" letter-spacing:="" -0="" 1px="" color:="" 31="" background-color:="" rgb="" 255=""><strong style=" font-family: " source="" sans="" pro="" sans-serif="" font-weight:="" 700="">Delivering more world-class content to Arabic-speaking learners<br style=" font-family: " source="" sans="" pro="" sans-serif="" /></strong>Learners can now access an additional 2,000 courses on Coursera in Arabic. These include world-class courses from leading universities and industry leaders, including<span> </span><a href="https://www.coursera.org/learn/python" style=" font-family: " source="" sans="" pro="" sans-serif="" background:="" 0px="" transition:="" all="" 1s="" ease-in-out="" 0s="" color:="" rgb="" 0="" 86="" 210="" text-decoration:="" none="">Programming for Everybody</a><span> </span>(Getting Started with Python) by the University of Michigan,<span> </span><a href="https://www.coursera.org/learn/careerdevelopment" style=" font-family: " source="" sans="" pro="" sans-serif="" background:="" 0px="" transition:="" all="" 1s="" ease-in-out="" 0s="" color:="" rgb="" 0="" 86="" 210="" text-decoration:="" none="">English for Career Development</a><span> </span>by the University of Pennsylvania, and<span> </span><a href="https://www.coursera.org/learn/machine-learning-duke" style=" font-family: " source="" sans="" pro="" sans-serif="" background:="" 0px="" transition:="" all="" 1s="" ease-in-out="" 0s="" color:="" rgb="" 0="" 86="" 210="" text-decoration:="" none="">Introduction to Machine Learning</a><span> </span>by Duke University. </p>
<p style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 25px="" 0px="" font-size:="" 16px="" line-height:="" 24px="" letter-spacing:="" -0="" 1px="" color:="" 31="" background-color:="" rgb="" 255=""><strong style=" font-family: " source="" sans="" pro="" sans-serif="" font-weight:="" 700=""><strong style=" font-family: " source="" sans="" pro="" sans-serif="" font-weight:="" 700="">Appointing a regional leader for the Middle East operations </strong><br style=" font-family: " source="" sans="" pro="" sans-serif="" /></strong>As we double down on efforts to help companies in the region implement their talent transformation agenda, we’re delighted to welcome Kais Zribi as Middle East, North Africa and Turkey (MENAT) Regional Director. He comes with over 20 years of technology and corporate learning experience in leading companies such as Intel Corporation, Samsung and Pearson Education. In his new capacity, he will work closely with our regional customers to support their reskilling and upskilling priorities.</p>
<p style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 25px="" 0px="" font-size:="" 16px="" line-height:="" 24px="" letter-spacing:="" -0="" 1px="" color:="" 31="" background-color:="" rgb="" 255="">The pandemic has propelled the Middle East towards a future shaped by innovation and technology. We’re excited to help learners in the region develop high-demand digital skills for better career opportunities and engage with organisations to accelerate their skills development strategy.</p>
                            
                            
                            
                            
                            
                            
                            ', N'           The accelerated adoption of online learning during the pandemic has created new opportunities for large-scale skills development in the Middle East (ME). Many more learners in the region are using online learning to develop job-relevant skills in a rapidly changing economy. 

', 0, 1, 1, CAST(N'2022-06-13T18:27:58.037' AS DateTime), CAST(N'2022-06-23T13:24:39.607' AS DateTime), 1001, 1054)
GO
INSERT [dbo].[post] ([id], [title], [thumbnail], [content], [description], [featured], [flag], [status], [created_at], [updated_at], [userid], [categoryId]) VALUES (1019, N'What’s new on Coursera for Business – October 2019 ', N'0b5b3d36-49ef-4b8a-a296-41455752da52.png', N'                                                                                                                                                                                                                                                                                                                                <p><em source="" sans="" pro="" sans-serif="" font-style:="" italic="">By Kyle Clark, Senior Skills Transformation Consultant</em></p>


<p style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 0px="" 25px="" font-size:="" 16px="" line-height:="" 24px="" letter-spacing:="" -0="" 1px="" color:="" 31="" background-color:="" rgb="" 255=""><em style=" font-family: " source="" sans="" pro="" sans-serif="" font-style:="" italic=""><img src="https://the-courserian-blog.mystagingwebsite.com/wp-content/uploads/2019/08/New-Courses-blog-1-1.png" style="width: 100%;" /></em></p>


<p style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 0px="" 25px="" font-size:="" 16px="" line-height:="" 24px="" letter-spacing:="" -0="" 1px="" color:="" 31="" background-color:="" rgb="" 255=""><span style="letter-spacing: -0.1px;">Coursera released 50+ courses on our platform in October. This month brings a number of new courses focused on innovation and disruption, from developing a systems mindset to digital transformation, AI workflows, and futures thinking.</span></p>


<p style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 25px="" 0px="" font-size:="" 16px="" line-height:="" 24px="" letter-spacing:="" -0="" 1px="" color:="" 31="" background-color:="" rgb="" 255="">Here are our top picks for enterprise for this past month:</p>


<p style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 25px="" 0px="" font-size:="" 16px="" line-height:="" 24px="" letter-spacing:="" -0="" 1px="" color:="" 31="" background-color:="" rgb="" 255=""><strong style=" font-family: " source="" sans="" pro="" sans-serif="" font-weight:="" 700="">October 2019’s Key Launches:</strong></p>


<ul style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 0px="" 28px="" 40px="" color:="" 31="" font-size:="" 16px="" letter-spacing:="" -0="" 1px="" background-color:="" rgb="" 255=""><li style="text-align: left; font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" none="" padding-left:="" 10px="" margin:="" 0px="" 15px="" text-indent:="" -13px=""><a href="https://www.coursera.org/learn/systems-mindset" style=" font-family: " source="" sans="" pro="" sans-serif="" background:="" 0px="" transition:="" all="" 1s="" ease-in-out="" 0s="" color:="" rgb="" 0="" 86="" 210="" text-decoration:="" none="">Developing a Systems Mindset</a>, University of Colorado Boulder – This course will highlight the urgency for you to have a systems mindset to engage complex problems for a systems perspective, meaning that you have approach problems from different angles, scales and perspectives.  This class is the first step in creating that mindset and for you to effectively engage – from receiving the “ask” for “assistance”, to orienting yourself to the issue, understanding the community, and developing a project plan. </li></ul>


<div style="text-align: center; text-indent: -13px;"><span style="color: rgb(31, 31, 31); font-family: " source="" sans="" pro="" sans-serif="" font-size:="" 16px="" letter-spacing:="" -0="" 1px="">d<iframe rte-for="insertvideo" border="0" data-url="https://youtu.be/D-474JTNuD0" src="https://youtube.com/embed/D-474JTNuD0?wmode=opaque" style=" color: rgb(65, 65, 65); font-size: 14px; text-align: center; max-width: 100%; width: 600px; height: 337px"></iframe></span></div>


<ul style=" font-family: " source="" sans="" pro="" sans-serif="" margin:="" 0px="" 28px="" 40px="" color:="" 31="" font-size:="" 16px="" letter-spacing:="" -0="" 1px="" background-color:="" rgb="" 255=""><li style="text-align: left; font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" none="" padding-left:="" 10px="" margin:="" 0px="" 15px="" text-indent:="" -13px=""><a href="https://www.coursera.org/learn/digital-transformation-impact" style=" font-family: " source="" sans="" pro="" sans-serif="" background:="" 0px="" transition:="" all="" 1s="" ease-in-out="" 0s="" color:="" rgb="" 0="" 86="" 210="" text-decoration:="" none="">Impact from Digital Transformation: Full course</a>, EIT Digital – This course is about what you can do when everything around you seems to be moving due to digital change. It is about how to handle the disruptive process that tends to unfold in industry nowadays due to digitalisation. The way to handle this is what is here referred to as “Digital Transformation” and at the core of it, it is about understanding how the new business landscape is evolving and heading for a new position in that landscape. It is about corporate strategy.</li><li style=" font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" none="" padding-left:="" 10px="" margin:="" 0px="" 15px="" text-indent:="" -13px=""><a href="https://www.coursera.org/specializations/ibm-ai-workflow" style=" font-family: " source="" sans="" pro="" sans-serif="" background:="" 0px="" transition:="" all="" 1s="" ease-in-out="" 0s="" color:="" rgb="" 0="" 86="" 210="" text-decoration:="" none="">IBM AI Enterprise Workflow Specialization</a>, IBM – This six course specialization is designed to prepare you to take the certification examination for IBM AI Enterprise Workflow V1 Data Science Specialist. IBM AI Enterprise Workflow is a comprehensive, end-to-end process that enables data scientists to build AI solutions, starting with business priorities and working through to taking AI into production. After successfully completing this specialization, you will be ready to take the official IBM certification examination for the IBM AI Enterprise Workflow.</li><li style=" font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" none="" padding-left:="" 10px="" margin:="" 0px="" 15px="" text-indent:="" -13px=""><a href="https://www.coursera.org/learn/exploratory-data-analysis-matlab" style=" font-family: " source="" sans="" pro="" sans-serif="" background:="" 0px="" transition:="" all="" 1s="" ease-in-out="" 0s="" color:="" rgb="" 0="" 86="" 210="" text-decoration:="" none="">Exploratory Data Analysis with MATLAB</a>, MathWorks – In this course, you will learn to think like a data scientist and ask questions of your data.  These skills are valuable for those who have domain knowledge and some exposure to computational tools, but no programming background is required. </li><li style=" font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" none="" padding-left:="" 10px="" margin:="" 0px="" 15px="" text-indent:="" -13px=""><a href="https://www.coursera.org/specializations/futures-thinking" style=" font-family: " source="" sans="" pro="" sans-serif="" background:="" 0px="" transition:="" all="" 1s="" ease-in-out="" 0s="" color:="" rgb="" 0="" 86="" 210="" text-decoration:="" none="">Futures Thinking Specialization</a>, Institute for the Future – Do you want to think about the future with more creativity and optimism? Do you want to see what’s coming faster, so you can be better prepared for disruptions and more in control of your future? This Specialization will introduce you to the practice of futures thinking, as developed and applied for the past 50 years by the Institute for the Future, a Silicon-Valley-based research and learning group founded in 1968. The Futures Thinking specialization is for anyone who wants to spot opportunities for innovation and invention faster.</li><li style=" font-family: " source="" sans="" pro="" sans-serif="" list-style-type:="" none="" padding-left:="" 10px="" margin:="" 0px="" 15px="" text-indent:="" -13px=""><a href="https://www.coursera.org/learn/uol-machine-learning-for-all" style=" font-family: " source="" sans="" pro="" sans-serif="" background:="" 0px="" transition:="" all="" 1s="" ease-in-out="" 0s="" color:="" rgb="" 0="" 86="" 210="" text-decoration:="" none="">Machine Learning for All</a>, University of London – In this course you will learn to understand the basic idea of machine learning, even if you don’t have any background in math or programming. You might be a manager or other non-technical role in a company that is considering using Machine Learning. You really need to understand this technology, and this course is a great place to get that understanding.</li></ul>
                            
                            
                            
                            
                            
                            
                            
                            
                            
                            ', N'         Coursera released 50+ courses on our platform in October. This month brings a number of new courses focused on innovation and disruption, from developing a systems mindset to digital transformation, AI workflows, and futures thinking.', 1, 1, 1, CAST(N'2022-06-13T21:03:14.750' AS DateTime), CAST(N'2022-07-20T21:59:35.030' AS DateTime), 1001, 1044)
GO
